import './Ball.css';
import React, { useState } from 'react';

function Ball(props) {
    const [gravity, setGravity] = useState(1);
    //const [x, setX] = useState();
    
    document.getElementById("p1").innerHTML = "sadvasd";
    
    return(
    <div className = "Ball">
        <p>
        <img src="https://clipart.info/images/ccovers/1495749720Bowling-Ball-PNG-Clip-Art.png" className="Ball" alt="logo"></img>
        </p>
    </div>
  )
}

export default Ball;
